import img1 from '../image/image 1.jpg';
import img2 from '../image/image 2.jpg';
import img3 from '../image/image 3.jpg';
import img4 from '../image/image 4.jpg';
import img5 from '../image/image 5.jpg';
import img6 from '../image/image 6.jpg';

const data = {
    cardData : [
        {
            id:1,
            img: img1,
            title: 'blog 1',
            desc: 'desc 1'
        },
        {
            id:2,
            img: img2,
            title: 'blog 2',
            desc: 'desc 2'
        },
        {
            id:3,
            img: img3,
            title: 'blog 3',
            desc: 'desc 3'
        },
        {
            id:4,
            img: img4,
            title: 'blog 4',
            desc: 'desc 4'
        },
        {
            id:5,
            img: img5,
            title: 'blog 5',
            desc: 'desc 5'
        },
        {
            id:6,
            img: img6,
            title: 'blog 6',
            desc: 'desc 6'
        },
        {
            id:1,
            img: 'img1',
            title: 'blog 1',
            desc: 'desc 1'
        }
    ]
}
export default data
